package data

import (
	"bytes"
	"compress/gzip"
	"encoding/hex"
	"io"
)

var dataHex = ""

// Hàm trả về io.ReadSeeker từ chuỗi dữ liệu []byte
func GetReaderFromData() io.ReadSeeker {

	// Giải nén dữ liệu
	dataCompressed, err := hex.DecodeString(dataHex)
	if err != nil {
		panic(err)
	}
	buf := bytes.NewBuffer(dataCompressed)
	zr, err := gzip.NewReader(buf)
	if err != nil {
		panic(err)
	}

	// Đọc dữ liệu sau khi giải nén
	var result bytes.Buffer
	_, err = io.Copy(&result, zr)
	if err != nil {
		panic(err)
	}
	err = zr.Close()
	if err != nil {
		panic(err)
	}

	return bytes.NewReader(result.Bytes())
}
